import styled from "styled-components";

export const Container = styled.div`
  background-color: rgb(23, 45, 55);
  width: 100%;
  padding: 10px;
  color: rgb(255, 255, 255);
  display: flex;
  gap: 10px;
`;

export const Wrapper = styled.div`
  height: 100%;
`;
